      "title": "推荐南湾这家拉面",
      "desc": "周二晚上在附近，看到xhs有人推荐，在google上搜了半天没找到地址，去了才发现就是小香米粉隔壁。\n\t\n点了传统拉面，我要的毛细，非常赞，又点了个酸辣粉，酸辣粉就是正常的酸辣粉，是好吃的但不觉得惊艳。羊肉串确实不错，我一人吃了5串[害羞R]\n\t\n主要是价格确实挺好的。不像别的拉面店动辄20块钱一碗面。拉面好像12-13，量也挺大的。要是能在我们半岛开一家就好了。\n\t\n附近的可以把这个列为食堂了。\n忘了放地址：noodlepanda\n1161 Lawrence Expy, Sunnyvale, CA 94089, United States\n#湾区美食[话题]# #sunnyvale[话题]# #牛肉拉面[话题]# #noodlepanda[话题]#",
